  `scopeId` varchar(191) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `techStack` text CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci,
  `srs` text CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci,
