INSERT INTO `rubric` VALUES ('cml7y978q001lv9c00lx5s7rb','Web Development : 1','WEB DEVELOPMENT',1,'[{\"name\":\"Tech Stack & Architecture\",\"maxMarks\":20,\"description\":\"Justification of selected technology stack (MERN/PERN/etc.) with a clear system flow diagram explaining component interactions.\"},{\"name\":\"DB Schema & Entity Design\",\"maxMarks\":20,\"description\":\"ER diagrams showing entities, relationships, table structures, and appropriate data type definitions.\"},{\"name\":\"UI/UX Wireframes & Theme\",\"maxMarks\":30,\"description\":\"Wireframes created using Figma/Adobe XD or hand-drawn sketches illustrating user journey, layout, and chosen color palette.\"},{\"name\":\"Project Boilerplate Setup\",\"maxMarks\":20,\"description\":\"GitHub repository initialization with proper client-server folder structure and environment variable configuration.\"},{\"name\":\"GitHub Workflow & Documentation\",\"maxMarks\":10,\"description\":\"Includes .gitignore setup, initial README with installation steps, and a clear branching strategy.\"}]',100,1,'2026-02-04 11:33:58.634','2026-02-04 11:33:58.634'),('cml7yfkkn001mv9c0ej3ad3dh','Web Development : 2','WEB DEVELOPMENT',2,'[{\"name\":\"Backend API Development\",\"maxMarks\":25,\"description\":\"RESTful API routes are properly designed, implemented, and tested using Postman or Thunder Client.\"},{\"name\":\"Database & Auth Integration\",\"maxMarks\":25,\"description\":\"Successful database connection with secure authentication implemented using JWT or Firebase Authentication.\"},{\"name\":\"Full-Stack CRUD\",\"maxMarks\":25,\"description\":\"Frontend UI components correctly fetch, display, create, update, and delete data through backend APIs.\"},{\"name\":\"State Management\",\"maxMarks\":15,\"description\":\"Efficient frontend state handling implemented using React Hooks, Redux, or Zustand for smooth data flow.\"},{\"name\":\"Error Handling & Security\",\"maxMarks\":10,\"description\":\"Server-side input validation, secure HTTP headers, and basic error logging mechanisms are implemented.\"}]',100,1,'2026-02-04 11:38:55.847','2026-02-04 11:38:55.847'),('cml7ygkeq001nv9c0u0sgig3s','Web Development : 3','WEB DEVELOPMENT',3,'[{\"name\":\"UI/UX Refinement\",\"maxMarks\":25,\"description\":\"Final UI styling with responsive layouts for mobile and desktop, smooth animations, and user feedback using loaders and toast notifications.\"},{\"name\":\"Advanced Logic\",\"maxMarks\":20,\"description\":\"Implementation of search, filtering, pagination, or integration with third-party services such as payments, maps, or Cloudinary.\"},{\"name\":\"Performance & Testing\",\"maxMarks\":15,\"description\":\"Optimized database queries, frontend code splitting, and basic unit or integration testing for reliability.\"},{\"name\":\"Production Deployment\",\"maxMarks\":20,\"description\":\"Application deployed to live hosting platforms like Vercel, Render, or AWS with a working URL and CI/CD pipeline.\"},{\"name\":\"Documentation & Final Viva\",\"maxMarks\":20,\"description\":\"Comprehensive project report, API documentation using Swagger or Postman, and clear code explanation during viva.\"}]',100,1,'2026-02-04 11:39:42.290','2026-02-04 11:39:42.290'),('cml7yhz46001ov9c0sf5a5xe5','Mobile App Development : 1','MOBILE APP DEVELOPMENT',1,'[{\"name\":\"Tech Stack & App Architecture\",\"maxMarks\":20,\"description\":\"Clear separation between frontend and backend with a well-organized folder structure and scalable architecture.\"},{\"name\":\"Project Initialization & Git Setup\",\"maxMarks\":15,\"description\":\"Repository properly initialized with meaningful commits, correct .gitignore configuration, and version control usage.\"},{\"name\":\"Frontend Folder Structure\",\"maxMarks\":20,\"description\":\"Structured frontend directories such as src, screens, components, and services following best practices.\"},{\"name\":\"Navigation Flow\",\"maxMarks\":20,\"description\":\"Application navigation flow from splash screen to login and home screens works correctly without breaks.\"},{\"name\":\"UI Screens & Components\",\"maxMarks\":15,\"description\":\"Well-designed login UI with reusable components like buttons, input fields, and loaders.\"},{\"name\":\"Code Quality & Consistency\",\"maxMarks\":10,\"description\":\"Consistent naming conventions, clear file responsibilities, and avoidance of redundant or duplicated code.\"}]',100,1,'2026-02-04 11:40:48.001','2026-02-04 11:45:04.139'),('cml7yiv4i001pv9c0sa3p9hh3','Mobile App Development : 2','MOBILE APP DEVELOPMENT',2,'[{\"name\":\"Backend API Structure\",\"maxMarks\":20,\"description\":\"Express server is properly set up with clear separation of routes, controllers, and services following best practices.\"},{\"name\":\"Database Schema & Integration\",\"maxMarks\":15,\"description\":\"User table is designed with a role field and successfully connected to the database with proper configuration.\"},{\"name\":\"Authentication APIs\",\"maxMarks\":25,\"description\":\"Signup and login APIs function correctly with secure password hashing and validation.\"},{\"name\":\"JWT Implementation & Security\",\"maxMarks\":20,\"description\":\"JWT tokens are generated securely with middleware enforcing protected routes and authorization checks.\"},{\"name\":\"Frontend???Backend Integration\",\"maxMarks\":10,\"description\":\"Login functionality works end-to-end with token storage and proper logout handling.\"},{\"name\":\"Role-based Navigation\",\"maxMarks\":10,\"description\":\"Application navigation dynamically adapts based on user roles such as student, mentor, and admin.\"}]',100,1,'2026-02-04 11:41:29.489','2026-02-04 11:45:15.841'),('cml7ymigo001rv9c0g9q032op','Mobile App Development : 3','MOBILE APP DEVELOPMENT',3,'[{\"name\":\"Core Feature Implementation\",\"maxMarks\":25,\"description\":\"Core application features such as dashboard and complete CRUD workflows are fully implemented and functioning correctly.\"},{\"name\":\"API Integration Layer\",\"maxMarks\":15,\"description\":\"Centralized API service layer is implemented with proper authentication headers and reusable request handling.\"},{\"name\":\"File Upload Feature\",\"maxMarks\":15,\"description\":\"End-to-end file upload functionality supports image and PDF uploads from frontend to backend.\"},{\"name\":\"UX & Error Handling\",\"maxMarks\":15,\"description\":\"User experience enhancements include loaders, clear error messages, and overall application stability.\"},{\"name\":\"Performance & App Optimization\",\"maxMarks\":10,\"description\":\"Optimized UI performance using efficient list rendering (such as FlatList) and smooth user interactions.\"},{\"name\":\"Build Readiness & Documentation\",\"maxMarks\":20,\"description\":\"Application build is generated (APK/AAB) with complete README documentation and setup instructions.\"}]',100,1,'2026-02-04 11:44:19.704','2026-02-04 11:45:25.640'),('cml7yp6l8001sv9c0fktpg51y','AI : 1','AI',1,'[{\"name\":\"Literature & Repo Analysis\",\"maxMarks\":20,\"description\":\"Demonstrate two relevant GitHub repositories or research papers related to the problem and clearly list three technical pros and cons of their approaches.\"},{\"name\":\"Model Setup & Connectivity\",\"maxMarks\":30,\"description\":\"Show the AI model running locally or a valid API key connection responding correctly to a test script.\"},{\"name\":\"Architecture & DB Schema\",\"maxMarks\":20,\"description\":\"Present the ER diagram and a complete system flowchart illustrating User to Frontend to Backend to AI to Database interaction.\"},{\"name\":\"UI/UX Wireframes\",\"maxMarks\":15,\"description\":\"Provide Figma or hand-drawn wireframes clearly indicating AI result placement and loading or processing states.\"},{\"name\":\"Git Boilerplate & Env Setup\",\"maxMarks\":15,\"description\":\"Repository initialized with a clean folder structure and secure environment variable configuration using .env files.\"}]',100,1,'2026-02-04 11:46:24.284','2026-02-04 11:46:24.284'),('cml7yq5jq001tv9c0xeqqlxsu','AI : 2','AI',2,'[{\"name\":\"Core AI Logic & Backend\",\"maxMarks\":25,\"description\":\"Demonstrate the complete AI processing pipeline where the backend API accepts input, processes it through the AI logic, and returns the result correctly.\"},{\"name\":\"Latency & Async Handling\",\"maxMarks\":20,\"description\":\"Show implementation using async/await or background task handling to ensure the server remains responsive during AI processing.\"},{\"name\":\"Basic Frontend Implementation\",\"maxMarks\":25,\"description\":\"Provide a draft frontend using React, Flutter, or Streamlit that can send requests to the backend and display AI outputs without focusing on final styling.\"},{\"name\":\"Database & Auth Integration\",\"maxMarks\":15,\"description\":\"Show successful storage and retrieval of user data or AI interaction history from the database with proper integration.\"},{\"name\":\"Git Progress & Commit History\",\"maxMarks\":15,\"description\":\"Demonstrate consistent commit history from Day 10 to Day 20 with modular code structure instead of a single large file.\"}]',100,1,'2026-02-04 11:47:09.590','2026-02-04 11:47:09.590'),('cml7yrcdc001uv9c0s6kegcr8','AI : 3','AI',3,'[{\"name\":\"UI Component Refinement\",\"maxMarks\":25,\"description\":\"Upgrade the basic UI from Review II by completing all buttons, inputs, and layouts with a professional and user-friendly appearance.\"},{\"name\":\"UX Feedback & Loading States\",\"maxMarks\":20,\"description\":\"Application clearly displays loading indicators such as spinners or progress bars during AI processing with no blank or frozen screens.\"},{\"name\":\"Production Deployment\",\"maxMarks\":20,\"description\":\"Project is deployed on a live hosting platform such as Vercel, Render, or AWS and works correctly on the evaluator???s device or browser.\"},{\"name\":\"Robustness & Stress Test\",\"maxMarks\":15,\"description\":\"Application handles invalid input or API timeouts gracefully by showing clear error messages without crashing.\"},{\"name\":\"Final Documentation & Demo\",\"maxMarks\":20,\"description\":\"Professional README.md and final technical report are provided, and the team can clearly explain the full codebase.\"}]',100,1,'2026-02-04 11:48:05.088','2026-02-04 11:48:05.088');
